import "./Form.css";

const Form = () => {
  return (
    <div className="form">
      <select>
        <option>+</option>
        <option>-</option>
      </select>
      <input placeholder="Add description"></input>
      <input placeholder="Value"></input>
      <button className="form__button">
        <i class="fa-solid fa-check"></i>
      </button>
    </div>
  );
};

export default Form;
